import React, { Component } from 'react';
import './index.scss';
import { mixins } from '../../../utils/decorater';

const Foo = {
    foo() { console.log('foo') }
  };


@mixins(Foo)
class Shuiqiu extends Component{

    componentDidMount(){
        this.foo();
    }


    render(){
        return(
            <div className="shuiqiu">
                <div className="shuiqiucontent">
                    <div className="shui shui1"></div>
                    <div className="shui shui2"></div>
                    <div className="shui shui3"></div>
                    <div className="shui shui4"></div>
                    <div className="shui shui5"></div>
                    <div className="shui shui6"></div>
                </div>
            </div>
        )
    }
}

export default Shuiqiu;
